import react from "react";
import "./ExpenseList.css";
import ExpenseItem from "./ExpenseItem";

function ExpenseList(props) {
  let expenseContent = props.items
    .filter((filtYear) => {
      return filtYear.date.getFullYear().toString() === props.yeear;
    })
    .map((expense) => (
      <ExpenseItem
        key={expense.id}
        title={expense.title}
        amount={expense.amount}
        date={expense.date}
      />
    ));

  if (expenseContent == 0) {
    expenseContent = <p>No content found</p>;
  }

  return <ul className="expenses-list">{}</ul>;
}

export default ExpenseList;
